    ###     2. Construct tensor `Y` of target sentences with shape (tgt_len, b, e) using the target model embeddings.
    ###         where tgt_len = maximum target sentence length, b = batch size, e = embedding size.
    ###     3. Use the torch.split function to iterate over the time dimension of Y.
    ###         Within the loop, this will give you Y_t of shape (1, b, e) where b = batch size, e = embedding size.
    ###             - Squeeze Y_t into a tensor of dimension (b, e).
    ###             - Construct Ybar_t by concatenating Y_t with o_prev on their last dimension
    ###             - Use the step function (will be implemented in question 1.6)
    ###               to compute the the Decoder's next (cell, state) values
    ###               as well as the new combined output o_t.
    ###             - Append o_t to combined_outputs
    ###             - Update o_prev to the new o_t.
    ###     4. Use torch.stack to convert combined_outputs from a list length tgt_len of
    ###         tensors shape (b, h), to a single tensor shape (tgt_len, b, h)
    ###         where tgt_len = maximum target sentence length, b = batch size, h = hidden size.
    ###
    ### Note:
    ###    - When using the squeeze() function make sure to specify the dimension you want to squeeze
    ###      over. Otherwise, you will remove the batch dimension accidentally, if batch_size = 1.
    ###
    ### You may find some of these functions useful:
    ###     Zeros Tensor:
    ###         https://pytorch.org/docs/stable/torch.html#torch.zeros
    ###     Tensor Splitting (iteration):
    ###         https://pytorch.org/docs/stable/torch.html#torch.split
    ###     Tensor Dimension Squeezing:
    ###         https://pytorch.org/docs/stable/torch.html#torch.squeeze
    ###     Tensor Concatenation:
    ###         https://pytorch.org/docs/stable/torch.html#torch.cat
    ###     Tensor Stacking:
    ###         https://pytorch.org/docs/stable/torch.html#torch.stack

    enc_hiddens_proj = model.att_projection(enc_hiddens)  # self → model

    Y = model.model_embeddings.target(target_padded)      # self → model

    for Y_t in torch.split(Y, 1, 0):  # time step-wise splitting
        Y_t = torch.squeeze(Y_t)      # shape: (b, e)
        Ybar_t = torch.cat((Y_t, o_prev), dim=1)  # concat with previous output

        dec_state, o_t, e_t = model.step(
            Ybar_t,
            dec_state,
            enc_hiddens,
            enc_hiddens_proj,
            enc_masks
        )

        combined_outputs.append(o_t)
        o_prev = o_t

    combined_outputs = torch.stack(combined_outputs)  # shape: (tgt_len, b, h)

    ### END YOUR CODE

    return combined_outputs

