    ###     Tanh:
    ###         https://pytorch.org/docs/stable/torch.html#torch.tanh


    ### END YOUR CODE
    alpha_t = F.softmax(e_t, 1)
    alpha_t = torch.unsqueeze(alpha_t, 1)
    a_t = torch.bmm(alpha_t, enc_hiddens)
    a_t = torch.squeeze(a_t, 1)
    #dec_hidden = torch.squeeze(dec_hidden, 2)
    U_t = torch.cat((a_t, dec_hidden), 1)
    V_t = model.combined_output_projection(U_t)
    O_t = model.dropout(torch.tanh(V_t))
    combined_output = O_t
    return dec_state, combined_output, e_t

